Ocr.Entry.prototype.collide = function(o1, o2, i){
 
    if (o1.x> o2.x + o2.w)
        return false;
    if (o1.x +o1.w <o2.x )
        return false;
    if (o1.y> o2.y + o2.h)
        return false;
    if (o1.y + o1.h < o2.xy)
        return false;

    return true;
}

/**
 * throttle function
 *  Tao do tre lang nghe su kien
 */
function throttle(fn, delay) {
      var timer = null;
      return function () {
        var context = this, args = arguments;
        clearTimeout(timer);
        timer = setTimeout(function () {
          fn.apply(context, args);
        }, delay);
      };
}

